import { gql } from "@apollo/client";
export const getUserByLogin = gql`
    query getUserByLogin(
            $username: String
            $password: String
        ) {
            getUserByLogin(
                firstName: $firstName
                lastName: $lastName
                username: $username
                password: $password
                email: $email
                created: $created
                isActive: $isActive
            ) {
                id
                username
                lastName
                firstName
                created
                email
                isActive
            }
        }

`;
